import './App.css';
import { NavLink, Switch, Route } from 'react-router-dom';

function App() {
    fetch("http://137.112.104.54:22051/test").then(res => res.text())
    .then(data => console.log("This is the data: " + data))
    .catch(console.log("Error fetching test"));

    return (
        <div className="App">
        <Navigation />
            <main>
                <h1>Quickly Create & Organize Documents With Module Text Blocks.</h1>
                <h2>A smarter way to build, organize, and refine your documents - flexible, efficient, and intuitive.</h2>
                <a className="button-link" href="signup">Get Started</a>
            </main>
        </div>
    );
}


const Navigation = () => (
    <nav>
        <NavLink to="/"><img src="TextBlock_LogoDark.png" alt="Logo"/></NavLink>
        <NavLink to="/about">About Us</NavLink>
        <NavLink to="/howitworks">How It Works</NavLink>
        <NavLink to="/faqs">FAQs</NavLink>
        <NavLink to="/login">Login</NavLink>
        <NavLink to="/signup">Sign Up</NavLink>
    </nav>
);

const Home = () => (
    <main>
        <h1>Quickly Create & Organize Documents With Module Text Blocks.</h1>
        <h2>A smarter way to build, organize, and refine your documents - flexible, efficient, and intuitive.</h2>
        <a className="button-link" href="signup">Get Started</a>
    </main>
);

const Login = () => (
    <main>
        <h1>Welcome Back</h1>
        {/* Login form here */}
    </main>
)

export default App;
